def get_char_count(s: str) -> dict:
    counts = {}
    for c in (c.lower() for c in s if c.isalnum()):
        counts[c] = counts.get(c, 0) - 1
    result = {}
    for (char, count) in counts.items():
        if count in result:
            result[count].append(char)
        else:
            result[count] = [char]
    for count in result:
        result[count].sort()
    return result

